/**
 * always sort on 3 numbers => O(1) sort => O(n) total
 * @param {number[]} nums
 * @return {number}
 */
var thirdMax_set = function (nums) {
    let cmp = (a, b) => b - a;
    let max3 = Array.from(new Set(nums)).reduce((a, c) => {
        if (a.length < 3) {
            a.push(c);
            a = a.sort(cmp);
        } else if (c > a[2]) { // c is greater than the min
            a[2] = c;
            a = a.sort(cmp);
        }
        return a;
    }, []);
    return max3[max3.length >= 3 ? 2 : 0];
};

var thirdMax = function (nums) {
    let max3 = nums.reduce((a, c) => {
        if (a.indexOf(c) >= 0) {
            return a;
        } else if (a.length < 3) {
            a.push(c);
        } else if (c > a[a.length - 1]) {
            a[a.length - 1] = c;
        }
        return a.sort((a, b) => b - a);
    }, []);
    return max3[max3.length >= 3 ? 2 : 0];
};

var thirdMax_slow = function (nums) {
    let results = Array.from(new Set(nums)).sort((a, b) => b - a);
    if (results.length >= 3) {
        return results[2];
    } else {
        return results[0];
    }
};

